import React from 'react'
import { useEffect } from 'react';
import CheckAuth from '../functions/checkAuthUnLogged';
import { useNavigate } from 'react-router-dom';
import { useState } from 'react';

export default function Add() {
  const navigate = useNavigate();

  useEffect(() => {
    CheckAuth(navigate);
  });

  const handleSubmit = (e) => {
    e.preventDefault();

  };

  const [inzerat, setInzerat] = useState({
    nazev: '',
    prijmeni: '',
    email: '',
    celyTelefon: '',
    telefon: '',
    predvolba: '+420',
    heslo: '',
    hesloZnovu: '',
    kraj: '',
    mesto: ''
  });

  return (
    <>
      <div className='container '>
        <div className='text-center'>
        <h2>Vložení Inzerátu</h2>
        <hr></hr>
        </div>
        <div className='text-center'>
        <h2>Inzerát</h2>
        <hr></hr>
        </div>
        <div className='row'>
          <form onSubmit={handleSubmit}>
            <div className='col-12 col-xxl-6 col-xl-6 col-lg-6 col-md-12 col-sm-12'>
            <label htmlFor='nazev_inzeratu' className='form-label'>Název</label>
                  <input id='nazev_inzeratu' type='text' className='form-control' placeholder='Audi RS3 MATRIX'
                    onChange={e => setInzerat({ ...inzerat, nazev_inzeratu: e.target.value })}></input>
            </div>
          </form>
        </div>
      </div>
    </>
  )
}
